// THIS BLOCK SHOULD APPEAR ON EACH EXCLUSION ZONE CALCULATION .js
//--------------------------------------------------------------------------------------

// Obtains the checkbox object related to the population exclusion
let flooding = document.getElementById('flooding');

// If the box is checked at the program start, then draw
if (!flooding.checked){
      draw_exclusion_flooding('rgba(0, 67, 112, 0.15)');
}

// Detects changes in the checkbox related to the population exclusion and "erase" by reloading or draws it
flooding.addEventListener('change', (event) => {

  if (flooding.checked){
    window.location.reload();
  } else {
      draw_exclusion_flooding('rgba(0, 67, 112, 0.15)');
  }
})

// // If the box is checked draw all exclusions by the same color
all_same_color.addEventListener('change', (event) => {

  if (all_same_color.checked){
      draw_exclusion_flooding('rgba(255, 0, 0, 0.9)');
  } else {
    window.location.reload();
  }
})

//--------------------------------------------------------------------------------------

function draw_exclusion_flooding(color){

      for (let i = 0; i < RiesgoInundacion.length; i++){
            addPolygonToMapFlooding(map, RiesgoInundacion[i], color);   
      }
}

// Function to draw polygons
function addPolygonToMapFlooding(map, coords, color) {

      var lineString = new H.geo.LineString(
            coords,
          'values lat lng alt');

      map.addObject(
      new H.map.Polygon(lineString, {
      style: {
            fillColor: color,
            strokeColor: color,
            lineWidth: 1,
            opacity: 0.1
            }
      }));  
}